import React, { Component } from "react";

class ProfessonalForm extends Component {
  render() {
    return (
      <fieldset>
        <legend>Dados Profissionais</legend>
        <div>
          Resumo do curriculo:
          <textarea name="resume" maxLength="1000" required/>
        </div>
        <div>
          Cargo:
          <input type="text" name="job" onMouseEnter="Preencha com cuidado esta informação"/>
        </div>
        <div>
          Descrição:
          <textarea name="description" maxLength="500"/>
        </div>
      </fieldset>
    )
  }
}

export default ProfessonalForm;
